g2:c.PROCEDURE.g2:a.TEXT:
t-g2-array-initial-values-transient-test(node: class benchmark-node )
error-obj: class error;
array1 : class g2-array;
seq_1, seq_2, seq_3: sequence;
str_1: structure;
val : symbol = the symbol values;


begin

{ all the arrays are transient arrays}

  { 1) empty  array} 
  create a integer-array array1;
  conclude that the  initial-values of array1 =   sequence(9,8,7,6);
  call g2-array-copy-elements-to-initial-values(array1);  
  seq_1 = the initial-values of array1;
  
  if   seq_1  /= sequence() 
    then
    begin
      call fail(node, "Failure with empty array. expected inital-values was empty array but the result  was [seq_1]");
      return;
    end;
 



  { 2) integer array} 
  delete array1;
  create a integer-array array1;
  conclude that the array-length of array1 = 3;
  seq_2 = sequence( 1,  2,  3);
  conclude that the g2-array-sequence of array1 = seq_2;
  seq_3 = sequence(11, 12, 13, 14);
  conclude that the  initial-values of array1 =  seq_3;
  call g2-array-copy-elements-to-initial-values(array1);  
  seq_1 = the initial-values of array1;

  if   seq_1  /= seq_2
    then 
    begin
      call fail(node, "Failure with initial values of integer array. expected initial-values was [seq_2] but the result was [seq_1]");
      return;
    end;



  { 3) float array} 
  delete array1;
  create a float-array array1;
  conclude that the array-length of array1 = 2;
  seq_2 = sequence( 0.5, 6.3);
  conclude that the g2-array-sequence of array1 = seq_2;
  seq_3 =  sequence(2.1, .22, 23.456);
  conclude that the initial-values of array1 = seq_3; 
  call g2-array-copy-elements-to-initial-values(array1);  
  seq_1 = the initial-values of array1;

  if   seq_1  /= seq_2
    then
    begin
      call fail(node, "Failure with initial values of float array. expected initial-values was [seq_2] but the result was [seq_1]");
      return;
    end;


 
  {  4) quantity array} 
  delete array1;
  create a quantity-array array1;
  conclude that the array-length of array1 = 2;
  seq_2 = sequence(9,8.8);
  conclude that the g2-array-sequence of array1 = seq_2;
  seq_3 =  sequence(1,90,44.56);
  conclude that the initial-values of array1 = seq_3; 
  call g2-array-copy-elements-to-initial-values(array1);  
  seq_1 = the initial-values of array1;

  if   seq_1  /= seq_2
    then 
    begin
      call fail(node,  "Failure with initial values of quantity array. expected initil-values was [seq_2] but the result was [seq_1]");
      return;
    end;


  {  5) truth-value array} 
  delete array1;
  create a truth-value-array array1;
  conclude that the array-length of array1 = 2;
  seq_2 = sequence(false, true);
  conclude that the g2-array-sequence of array1 = seq_2;
  seq_3 =  sequence(true, true, false);
  conclude that the initial-values of array1 =  seq_3;
  call g2-array-copy-elements-to-initial-values(array1);  
  seq_1 = the initial-values of array1;

  if   seq_1  /= seq_2
    then 
    begin
      call fail(node, "Failure with initial values of truth-value array. expected initial-values was [seq_2] but the result was [seq_1]");
      return;
    end;

 

  { 6) text array} 
  delete array1;
  create a text-array array1;
  conclude that the array-length of array1 = 2;
  seq_2 = sequence("abcd",  "pqrs");
  conclude that the g2-array-sequence of array1 = seq_2;
  seq_3 =   sequence("x", "y", "z");
  conclude that the initial-values of array1 = seq_3;
  call g2-array-copy-elements-to-initial-values(array1);  
  seq_1 = the initial-values of array1;
  
  if   seq_1  /=  seq_2
    then 
    begin
       call fail(node, "Failure with initial values of text array. expected initial-values was  [seq_2] but the result was [seq_1]");
       return;
    end;

  
  {  7) symbol array} 
  delete array1;
  create a symbol-array array1;
  conclude that the array-length of array1 = 3;
  seq_2 = sequence(the symbol abc2,  the symbol p9, the symbol 34t);
  conclude that the g2-array-sequence of array1 = seq_2;
  seq_3 =  sequence(the symbol 45yu);
  conclude that the initial-values of array1 =  seq_3;
  call g2-array-copy-elements-to-initial-values(array1);  
  seq_1 = the initial-values of array1;
  
  if   seq_1  /= seq_2
    then 
    begin
      call fail(node, "Failure with initial values of symbol array. expected initial-values was [seq_2] but the result was [seq_1]");
      return;
    end;


  {  8)  value array} 
  delete array1;
  create a value-array array1;
  conclude that the array-length of array1 = 5;
  seq_2 = sequence(the symbol abc2,  false, "abcd", 1, 6.7);
  conclude that the g2-array-sequence of array1 = seq_2;
  seq_3 =   sequence(the symbol 45yu);
  conclude that the initial-values of array1 = seq_3;
  call g2-array-copy-elements-to-initial-values(array1);  
  seq_1 = the initial-values of array1;

  if   seq_1  /= seq_2
    then 
    begin
      call fail(node, "Failure with initial values of value array. expected initial-values was [seq_2] but the result was [seq_1]");
      return;
    end;


  {  9)  item array}
  delete array1;
  create a item-array array1;
  conclude that the array-length of array1 = 2;
  seq_2 = sequence(radio_3,  radio_2);
  conclude that the g2-array-sequence of array1 = seq_2;
  seq_3 =  sequence(the symbol radio_1, the symbol radio_2); 
  conclude that the initial-values of array1 = seq_3;
  call g2-array-copy-elements-to-initial-values(array1);  
  seq_1 = the initial-values of array1;

  if   seq_1  /= sequence( the symbol radio_3, the symbol radio_2)
    then
    begin
      call fail(node, "Failure with initial values of item array. expected initial-values was sequence( the symbol radio_3, the symbol radio_2) but the result was [seq_1]");
      return;
    end;



{ 10) g2 array}
  delete array1;
  create a  g2-array array1;
  conclude that the array-length of array1 = 2;
  seq_2 = sequence(radio_3, radio_2,2,4.5);
  conclude that the g2-array-sequence of array1 = seq_2;
  conclude that the initial-values of array1 = sequence(the symbol radio_1, the symbol radio_2); 
  call g2-array-copy-elements-to-initial-values(array1);  
  str_1 = the initial-values of array1;
  seq_2 = the items of str_1;
  seq_3 = the sequence that is an attribute of str_1 named by val;
  


  if  seq_2[0]  /=  the symbol radio_3 or
      seq_2[1]  /=  the symbol radio_2 or
      seq_2[2]  has a current value or
      seq_2[3]  has a current value or
      seq_3[0]  has a current value or
      seq_3[1]  has a current value or
      seq_3[2]  /= 2 or
      seq_3[3]  /= 4.5 
      then 
     begin
      call fail(node, "Failure with initial values of g2 array. expected initial values was  structure(VALUES: sequence(none,none,2,4.5), ITEMS:sequence(the symbol RADIO_3, the symbol RADIO_2, none, none))  but the result was [str_1]");
      return;
      end; 


call pass(node);
end

t-g2-array-initial-values-permanent-test(node: class benchmark-node )
error-obj: class error;
seq_1, seq_2, seq_3: sequence;
valid : truth-value;
begin

{ all the arrays are  permanent arrays}

	{ 1) empty  array} 
	seq_2 =  sequence(9,8,7,6);
	conclude that the  initial-values of  empty_array =  seq_2;
	make  empty_array permanent;
	conclude that the array-is-permanent of  empty_array = true;

	call g2-array-copy-elements-to-initial-values(empty_array ); 
	seq_1 = the initial-values of empty_array ;
	if   seq_1  /= sequence() 
		then
		begin
			call fail(node, "Failure with an empty array. Expected initial-values was empty sequence but the result was [seq_1] ");
		return;
		end;



	{ 2) integer array} 
	conclude that the array-length of integer_array = 3;
	conclude that the g2-array-sequence of integer_array = sequence( 1,  2,  3);
	conclude that the  initial-values of integer_array =   sequence(11, 12, 13, 14);
	make  integer_array permanent;
	conclude that the array-is-permanent of  integer_array = true;

	call g2-array-copy-elements-to-initial-values(integer_array);  
	seq_1 = the initial-values of integer_array;
		if   seq_1  /= sequence() 
			then
			begin
				call fail(node, "Failure with an integer array. Expected initial-values was empty sequence but the result was [seq_1] ");
			return;
			end;




	{ 3) float array} 
	 conclude that the array-length of float_array = 2;
	conclude that the g2-array-sequence of float_array = sequence( 0.5, 6.3);
	conclude that the initial-values of float_array =   sequence(2.1, .22, 23.456);
	make  float_array permanent;
	conclude that the array-is-permanent of  float_array = true;

	call g2-array-copy-elements-to-initial-values(float_array);  
	seq_1 = the initial-values of float_array;
		if   seq_1  /= sequence() 
			then 
			begin
				call fail(node, "Failure with an float array. Expected initial-values was empty sequence but the result was [seq_1] ");
			return;
			end;




 
	{ 4) quantity array} 
	conclude that the array-length of quantity_array = 2;
	conclude that the g2-array-sequence of quantity_array = sequence(9,8.8);
	conclude that the initial-values of quantity_array =   sequence(1,90,44.56);
	make  quantity_array permanent;
	conclude that the array-is-permanent of  quantity_array = true;

	call g2-array-copy-elements-to-initial-values(quantity_array);  
	seq_1 = the initial-values of quantity_array;
		if   seq_1  /= sequence() 
			then
			begin
				call fail(node, "Failure with  quantity array. Expected initial-values was empty sequence but the result was [seq_1] ");
			return;
			end;





	{ 5) truth-value array} 
	conclude that the array-length of truth_value_array = 2;
	conclude that the g2-array-sequence of truth_value_array = sequence(false, true);
	conclude that the initial-values of truth_value_array =   sequence(true, true, false);
	make  truth_value_array permanent;
	conclude that the array-is-permanent of  truth_value_array = true;
	call g2-array-copy-elements-to-initial-values(truth_value_array);  
	seq_1 = the initial-values of truth_value_array;
		if   seq_1  /= sequence() 
			then
			begin
				call fail(node, "Failure with truth-value array. Expected initial-values was  empty sequence but the result was [seq_1] ");
			return;
			end;

 
 

	{ 6) text array} 
	conclude that the array-length of text_array = 2;
	conclude that the g2-array-sequence of text_array = sequence("abcd",  "pqrs");
	conclude that the initial-values of text_array =   sequence("x", "y", "z");
	make  text_array permanent;
	conclude that the array-is-permanent of  text_array = true;
	call g2-array-copy-elements-to-initial-values(text_array);  
	seq_1 = the initial-values of text_array;
		if   seq_1  /= sequence() 
			then
			begin
				call fail(node, "Failure with text array. Expected initial-values was empty sequence but the result was [seq_1] ");
			return;
			end;

 
  

	{ 7) symbol array}  
	conclude that the array-length of symbol_array = 3;
	conclude that the g2-array-sequence of symbol_array = sequence(the symbol abc2,  the symbol p9, the symbol 34t);
	conclude that the initial-values of symbol_array =   sequence(the symbol 45yu);
	make  symbol_array permanent;
	conclude that the array-is-permanent of  symbol_array = true;
	call g2-array-copy-elements-to-initial-values(symbol_array);  
	seq_1 = the initial-values of symbol_array;
		if   seq_1  /= sequence()
			then
			begin
				call fail(node, "Failure with symbol array. Expected initial-values was empty sequence but the result was [seq_1] ");
			return;
			end;


	{ 8) value array}  
	conclude that the array-length of value_array = 5;
	conclude that the g2-array-sequence of value_array = sequence(the symbol abc2,  false, "abcd", 1, 6.7);
	conclude that the initial-values of value_array =   sequence(the symbol 45yu);
	make  value_array permanent;
	conclude that the array-is-permanent of  value_array = true;
	call g2-array-copy-elements-to-initial-values(value_array);  
	valid = the initial-values of value_array has a current value;
		if   valid  = true
			then 
			begin
				call fail(node, "Failure with value array. Expected initial-values as empty sequence but was [the initial-values of value_array]");
			return;
			end;


	{9) item array} 
	conclude that the array-length of item_array = 2;
	conclude that the g2-array-sequence of item_array =sequence(computer_3, computer_2);
	conclude that the initial-values of item_array =  sequence(the symbol  computer_1, the symbol  computer_2); 
	make  item_array permanent;
	conclude that the array-is-permanent of  item_array = true;
	call g2-array-copy-elements-to-initial-values(item_array);  
	valid = the initial-values of item_array has a current value;
		if   valid  = true
			then
			begin
				call fail(node, "Failure with item array. Expected initial-values as empty sequence but was [the initial-values of item_array]");
			return;
			end;




	{ 10) g2 array} 
	conclude that the array-length of g2_array = 4;
	conclude that the g2-array-sequence of  g2_array =sequence(computer_3, computer_2, 3.0, 4);
	conclude that the initial-values of  g2_array =  sequence(the symbol  computer_2, the symbol  computer_1); 
	make  g2_array permanent;
	conclude that the array-is-permanent of  g2_array = true;
	call g2-array-copy-elements-to-initial-values(g2_array);  
	valid = the initial-values of g2_array has a current value;
		if   valid  = true
			then
			begin
				call fail(node, "Failure with g2 array. Expected empty structure but was [the initial-values of g2_array]");
			return;
			end;


call pass(node);
end
